      Break;
   When = "L"
      &IBMVERB = "Update";
      Break;
   When = "C"
      &IBMVERB = "Update";
      Break;
   When-Other
      &IBMVERB = "Retrieve";
   End-Evaluate;

   &IBMREC.IBM_OBJECT_VERB.Value = &IBMVERB;

   /*  ======================  EVENT_ID GEN   ==================================== */
